import ButtonGroup from '@mui/material/ButtonGroup';
import Button from '@mui/material/Button';
import { NavLink } from 'react-router-dom';


const HeaderButtonGroup: React.FC = () => {

  return (
    <div className="header-button-group-container">
      <ButtonGroup color="secondary" variant="text" aria-label="outlined button group">
      <NavLink to="/cadastro-cliente"><Button>CADASTRE-SE</Button></NavLink>
      <NavLink to="/login"><Button>ACESSE SUA CONTA</Button></NavLink>
      </ButtonGroup>
    </div>

  );
};

export default HeaderButtonGroup;
